def longest_common_subsequence(str1, str2):
    L = len(str1)
    R = len(str2)

    matrix = [[0 for x in range(R + 1)] for x in range(L + 1)]

    for i in range(L):
        for j in range(R):
            if i == 0 or j == 0:
                matrix[i][j] = 0
            elif str1[i - 1] == str2[j - 1]:
                matrix[i][j] = matrix[i - 1][j - 1] + 1
            else:
                matrix[i][j] = max(matrix[i][j - 1], matrix[i - 1][j])

    index = L
    seq = [str1[L - 1]]

    while index > 0:
        i = matrix[L][index]
        seq.append(str1[i])
        index -= 1

    return seq[::-1]

